import React from "react";

import NamelistItem from "./NamelistItem";

function Namelist(){
    const name={
        name:{}
    }
    return(
        <div>
            <ul>
                <NamelistItem name={name.name[0]} age={name.age[0]} />
                <NamelistItem name={name.name[1]} age={name.age[1]} />
                <NamelistItem name={name.name[2]} age={name.age[2]} />
                <NamelistItem name={name.name[3]} age={name.age[3]} />
            </ul>
        </div>
    );
}
export default Namelist;
